Add a little love and inspiration to your home with this farmhouse style sign! It’s shaped like a small house, cute and compact, and will fit perfectly anywhere in your home. It also stands alone so no need to hang it! It would make a perfect Wedding or Housewarming gift as well!

*****THIS ITEM IS READY TO SHIP*****

Specifications:
~ Reads: &quot;Live well, laugh often, love much&quot;;
~ Measures approximately 7”x6”x2”;
~ Stained a pretty Aqua/Turquoise, Jacobean, or Grey color;
~ Design is painted on with white, chalk-like paint;
~ Sealed with polycrylic to help protect the quality.

All of our products are handcrafted so while they will be similar, no two will ever be exactly alike. But that’s the beauty of buying Handmade! Each board is selected, cut, sanded, stained and painted by me. I believe the wood’s grain, various knots and imperfections add to its character and beauty. Therefore I do not attempt to hide them, only to enhance them. All of this is what makes your piece unique!

I am happy to combine shipping if you are interested in multiple items. Feel free to message with any questions!

Thank you for visiting my shop, I hope to make something for you soon!
